import './images';

const ChatSearch = () => {
    return (
        <div className="parent-container">
            <div class="container">
                <img src="nyc.jpg" alt="ny"/>
                <div class="centered">NYC Trip</div>
            </div>
            <div class="container1">
                <img src="birthday.jpg" alt="bday"/>
                <div class="centered">Leia's Surprise Party</div>
            </div>
        </div>
    );
}

export default ChatSearch
